// TravelPackage.js
import React from 'react';
import './TravelPackage.css';

const TravelPackage = () => {
  return (
    <div className="travel-package-page">
      <h1>TRAVEL PACKAGE</h1>
      <div className="package-container">
        <div className="form-section">
          <label>Choose Popular Travel Package:</label>
          <input type="text" />
          <label>Your Guide:</label>
          <input type="text" />
          <label>Time of Pickup:</label>
          <input type="text" />
          <label>Preferred Language:</label>
          <input type="text" />
          <button className="book-now">BOOK NOW</button>
        </div>
        <div className="contact-section">
          <button className="package-details">PACKAGE DETAILS</button>
          <p>Contact Us: +91 8765428742</p>
          <p>If you face any inconvenience with the guide, feel free to contact us.</p>
        </div>
      </div>
    </div>
  );
};

export default TravelPackage;
